import './App.css';
import React from 'react';
import { library } from '@fortawesome/fontawesome-svg-core'
import { fas } from '@fortawesome/free-solid-svg-icons'
import { faTwitter, faFontAwesome } from '@fortawesome/free-brands-svg-icons'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

library.add(fas, faTwitter, faFontAwesome)

function Place(props) {
  if (props.other) {
    return (
      <div id='place' className='border border-primary-1 rounded-5 m-5 p-5'>
        <p>Place</p>
        <form>
          <div className="form-floating mb-3">
            <input type="text" className="form-control" id="floatingInput" placeholder="Username" />
            <label htmlFor="floatingInput">Username</label>
          </div>
          <div className="form-floating">
            <input type="password" className="form-control" id="floatingPassword" placeholder="Password" />
            <label htmlFor="floatingPassword">Password</label>
          </div>
        </form>
      </div>
    );
  } else {
    return (
      <div>
        <button onClick={props.click(2)} type="button" className="btn btn btn-outline-primary"><FontAwesomeIcon icon="fas fa-magnifying-glass" style={{ color: "#613583", }} /></button>
        <p>Places</p>
      </div>
    );
  }
}



function Register(props){
  if (props.other) {
    return (
      <div id='register' className='border border-primary-1 rounded-5 m-5 p-5'>
        <p>Register</p>
        <form>
          <div className="form-floating mb-3">
            <input type="text" className="form-control" id="floatingInput" placeholder="Username" />
          </div>
          <div className="form-floating">
            <input type="password" className="form-control" id="floatingPassword" placeholder="Password" />
          </div>
        </form>
      </div>
    );
  } else {
    return (
      <div>
      <button onClick={props.click(2)} type="button" className="btn btn btn-outline-primary"><FontAwesomeIcon icon="fa-solid fa-address-card" style={{ color: "#613583", }} /></button>
      <p>Register</p>
    </div>
    );
  }
}


function LogIn(props) {
  if (props.other) {
    return (
      <div id='login' className='border border-primary-1 rounded-5 m-5 p-5'>
        <p>Log In</p>
        <form>
          <div className="form-floating mb-3">
            <input type="text" className="form-control" id="floatingInput" placeholder="Username" />
            <label htmlFor="floatingInput">Username</label>
          </div>
          <div className="form-floating">
            <input type="password" className="form-control" id="floatingPassword" placeholder="Password" />
            <label htmlFor="floatingPassword">Password</label>
          </div>
        </form>
      </div>
    );
  } else {
    return (
      <div>
        <button type="button" onClick={props.click(1)} className="btn btn btn-outline-primary"><FontAwesomeIcon icon="fas fa-user" style={{ color: "#613583", }} /></button>
        <p>Log In</p>
      </div>
    );
  }
}

class HomePage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      login: true,
      register: false,
      place: false
    }
    this.newClick = this.newClick.bind(this); 
  }

  newClick(btn) {
    switch(btn) {
      case 1: this.setState({login: true,
                      register: false,
                      place: false});
              break; 
      case 2: this.setState({login: false,
                             register: true,
                             place: false});
              break;
      default: this.setState ({login: false,
                               register: false,
                               place: true});
    }
  }

  render() {
    return (
      <div id="homepage" className='conteiner-fluid d-flex flex-column  align-items-center justify-content-center'>
        <LogIn other={this.state.login} click={this.newClick}/>
        <Register  other={this.state.register} click={this.newClick}/>
        <Place other={this.state.place} click={this.newClick}/>
      </div>
    );
  }
}

function App() {
  return (
    <div className="App">
      <HomePage />
    </div>
  );
}

export default App;
